# 2

def is_only_claim(x, y, w, h):
	global claimed
	for xx in range(x, x+w):
		for yy in range(y, y+h):
			if claimed[yy][xx] != 1:
				return False
	return True

for i in range(len(ls)):
	if is_only_claim(ls[i][0], ls[i][1], ls[i][2], ls[i][3]):
		print(i+1)
		break
